	bcc.s	.loop	;64FA
	move.w	#$7FFF,_custom+intreq.l	;33FC7FFF00DFF09C
;  
; The code is now in its proper place.
; So just jump on in.  All labels will now reslve to their
; correct absolute addresses.
;  
	jmp	GameStart.l	;4EF900000400

